member.example:
This sample shows how to call GetProjectAsync with required parameters and parse the result.

var endpoint = new Uri("<https://my-service.azure.com>");
var client = new RenameGetListClient(endpoint);

Response response = await client.GetProjectAsync("<projectName>", new RequestContext());

JsonElement result = JsonDocument.Parse(response.ContentStream).RootElement;
Console.WriteLine(result.GetProperty("projectName").ToString());
Console.WriteLine(result.GetProperty("projectKind").ToString());
Console.WriteLine(result.GetProperty("storageInputContainerName").ToString());
Console.WriteLine(result.GetProperty("settings").GetProperty("<test>").ToString());
Console.WriteLine(result.GetProperty("multilingual").ToString());
Console.WriteLine(result.GetProperty("description").ToString());
Console.WriteLine(result.GetProperty("language").ToString());
Console.WriteLine(result.GetProperty("createdDateTime").ToString());
Console.WriteLine(result.GetProperty("lastModifiedDateTime").ToString());
Console.WriteLine(result.GetProperty("lastTrainedDateTime").ToString());
Console.WriteLine(result.GetProperty("lastDeployedDateTime").ToString());

member.remarks:
Below is the JSON schema for the response payload.
Response Body:
Schema for Project: { projectName: string, # Required. projectKind: "CustomSingleLabelClassification" | "CustomMultiLabelClassification" | "CustomEntityRecognition", # Required. The project kind. storageInputContainerName: string, # Required. The storage container name. settings: Dictionary<string, string>, # Optional. The project settings. multilingual: boolean, # Optional. Whether the project would be used for multiple languages or not. description: string, # Optional. The project description. language: string, # Required. The project language. This is BCP-47 representation of a language. For example, use "en" for English, "en-gb" for English (UK), "es" for Spanish etc. createdDateTime: string (date & time), # Required. Represents the project creation datetime. lastModifiedDateTime: string (date & time), # Required. Represents the project last modification datetime. lastTrainedDateTime: string (date & time), # Required. Represents the project last training datetime. lastDeployedDateTime: string (date & time), # Required. Represents the project last deployment datetime. }

